import React from 'react';
import axios from 'axios';
import history from './history.js';
import './home.css';

var InitializeHomeFonts = () => {
    return(
        <head>
            <link href="https://fonts.googleapis.com/css?family=Public+Sans&display=swap" rel="stylesheet"></link>
            <link href="https://fonts.googleapis.com/css?family=PT+Sans&display=swap" rel="stylesheet"></link>
            <link href="https://fonts.googleapis.com/css?family=PT+Mono&display=swap" rel="stylesheet"></link>
        </head>
    );
}



export default class HomePage extends React.Component{
    constructor(props){
        super(props);
        this.state = {
            apiResponse: '',
        }
    }
    componentDidMount(){
        document.title = "VaccTrack.ph";
        this.callAPI();
    }
    callAPI(){
        axios.get(`http://localhost:9000/testApi`)
        .then((response) => {
            let data = response.data;
            this.setState({apiResponse: data});
        });
    }

    render(){
        return(
            <div>
                {/*INITIALIZE FONTS PORTION -> Head*/}
                <InitializeHomeFonts />
                {/*HOME PAGE PORTION -> Body*/}
                <p className="testString">{this.state.apiResponse}</p>
            </div>
        );
    }
}
